  \"Sea surface temperature (SST) and surface current data collected from the Mar
  Mostro during the around-the-world Volvo Ocean Race (VOR) from 2011-11-05 to 2012-07-12
  (NCEI Accession 0130694)\",\n\t\"tracking_summary\": {\n\t\t\"total\": 2,\n\t\t\"recent\":
