  false,\n\t\"url\": null,\n\t\"notes\": \"Navigation, surface current, sea surface
  temperature, wind, and atmospheric pressure data collected by the Mar Mostro during
  the around-the-world Volvo Ocean Race (VOR) 2011-2012 (http://www.volvooceanrace.com/en/home.html).
  The Mar Mostro is a 21.5m sail-powered racing yacht that was manned by the Puma
  Ocean Racing team (sponsored by the PUMA sports apparel company) and powered by
  Berg Propulsion of Sweden.Data were provided to the Center for Ocean-Atmospheric
  Prediction Studies at the Florida State University by Robert Hopkins, Jr. who served
  as the performance analyst and coach for the Mar Mostro during the 2011-2012 VOR.
  Co-author for the data was Tom Addis, Navigator and crew member for the team.\",\n\t\"license_title\":
